import SocialItem from "./SocialItem";

function Social() {
    return (
        <ul className="list-group">
            <SocialItem  media = 'Facebook'/>
            <SocialItem media = 'Youtube'/>
            <SocialItem media = 'instagram'/>
        
      
     </ul>
    )
}

export default Social;
